            <p>${e.detailedAnalysis||"이번 세션에서는 환자의 인지 기능과 감정 상태를 종합적으로 평가했습니다. 대화를 통해 나타난 반응과 참여도를 바탕으로 개인 맞춤형 치료 계획을 수립할 예정입니다."}</p>
